import React from "react";
import { NavLink } from "react-router-dom";
const NavBar = () => {
  const sty = {
    color: "red",
    textDecoration: "none",
    fontWeight: "bolder",
  };
  return (
    <>
      <nav>
        <ul>
          <li>
            <NavLink style={sty} to="/">
              Home
            </NavLink>
          </li>
          <li>
            <NavLink style={sty} to="/about">
              About
            </NavLink>
          </li>
          <li>
            <NavLink style={sty} to="/contact">
              Contact
            </NavLink>
          </li>
          <li>
            <NavLink style={sty} to="/help">
              Help
            </NavLink>
          </li>
        </ul>
      </nav>
    </>
  );
};

export default NavBar;
